"""# **Step 5: Gradient Descent Algorithm â›°**
**Link for More Resources**
- [Gradient Descent](https://blog.paperspace.com/intro-to-optimization-in-deep-learning-gradient-descent/)

**Cost Function**
- How do we choose m and b?
- Goal: Choose m, b values so that . . .
    - Our prediction is close to our real output (ground truth)
    - Method
        - Minimize â†’ the squared distance between y and the ground truth
**Gradient Descent Algorithm**
- We need some algorithm to find the lowest point in our cost graph
    - Minimize MSE(m.b)
- Gradient Descent
    - Repeat until convergence to minima {
        - Start with some guesses for m=0, b=0
        - Keep changing m.b to reduce MSE(m,b)

        }

**Minima of Loss Function**

- A particular value of weight for which the loss is minimum

**Gradient Descent**

- Check out all possible directions in the x-y plane
- Moving along which direction brings about the steepest decline in the value of the loss function
    - Direction opposite of the direction of the gradient
    - The gradient gives us the direction with the steepest ascent
    - At minima, gradient is zero

**The Contour of a Loss Function**
- The x and y axes represent the values of the two weights
- The z axes represent the value of the loss function for a particular value of two weights

**Derivative**

- The rate of change at a given point in a real-valued function
- The line might change a lot and be very curved or it might change a little and be flat and stationary

**First Derivative versus Second Derivative**

- First derivative: rate of change of the target function
- Second derivative: rate of change of the first derivative function
    - Derivative of the derivative function
    - Rate of change of the rate of change or how much the change in the function changes

**Gradient**

- Is the derivative of a function that has more than one input variable
- In vector calculus: a vector of derivatives for a function that takes a vector of input variables
    - Partial derivatives
        - A derivative for one of the variables for a multivariate function

**How to Interpret the Derivative**

- Magnitude of Derivative: how much change
- Sign of Derivative: direction of change

**Gradient Descent**

- How do we find the minima in this 3-dimensional graph representing the loss function?
- Check out all possible directions in the x-y plane
    - Moving in which direction brings the steepest decline in value in the loss function
    - Find the direction opposite to the direction of the gradient
        - Gradient gives us the direction with the steepest ascent

**The Direction of the Center**

- At the minima, where the contour is almost flat
    - The gradient is almost zero
- We can have a stopping condition if, after 10 or 20 iterations, the loss function values havenâ€™t changed from a certain threshold
- After this, we claim our training has converged

**The Contour of a Loss Function**



![mlImageOne.png](data:image/png;base64,)

**Direction of Steepest Descent**


![mlImageTwo.png](data:image/png;base64,)
"""

import random

#now we begin the gradient descent algorithm first with a for loop
for i in range(epochs):
  #y_hat is our prediction based on newly adjusted m and b values
  y_hat = m*x + b

  #Recall: mean squared error is how we evaluate how good our line is
  mse = (1/n) * np.sum((y-y_hat)**2)
  error.append(mse)

  plt.plot
  #There's a derivation for the derivative that is not shown in our Python code
  #gradient descent required us to calculate the negative gradient
  #the negative gradient tells us how to move to minimize error
  derivative_m = (-2/n) * np.sum(x*(y - y_hat))
  derivative_b = (-2/n) * np.sum(y - y_hat)

  #this is where we adjust the values of m and b
  m = m - Learning_Rate * derivative_m
  b = b - Learning_Rate * derivative_b
  
